import React, { Component } from "react";
import PharmacyLogoPicture from "../../Images/pharmacyLogo.jpg" ;
import Axios from "axios";
import GetAuthorisation from "../../Funciton/GetAuthorisation";




const API_URL="http://localhost:8080";

class FoundPharmaciesForDateRange extends Component {
	
    
    state = {
        
        selectedDate: new Date(),
		hours: new Date().getHours(),
		minutes: new Date().getMinutes(),
        pharmacists: [],
		hiddenPharmacist: true,

        

		

    };

   
  


  componentDidMount() {

    
    this.setState({selectedDate: new Date(
        this.props.selectedDate.getFullYear(),
        this.props.selectedDate.getMonth(),
        this.props.selectedDate.getDate(),
        this.props.hours,
        this.props.minutes,
        0,
        0
    )


    });
    console.log(this.state.selectedDate);
   

  
	}
    
    showPharmacistForPharmacy = (pharmacy) => {
		this.setState({
			selectedPharmacyId: pharmacy.Id,
			pharmacyName: pharmacy.EntityDTO.name,
			pharmacyAddress: pharmacy.EntityDTO.address.street + ", " + pharmacy.EntityDTO.address.city + ", " + pharmacy.EntityDTO.address.country,
			pharmacyGrade: pharmacy.EntityDTO.grade,
			pharmacyPrice: pharmacy.EntityDTO.discountPrice,
			consultationDate: new Date(
				this.state.selectedDate.getFullYear(),
				this.state.selectedDate.getMonth(),
				this.state.selectedDate.getDate(),
				this.state.hours,
				this.state.minutes,
				0,
				0
			).getTime(),
		});
		Axios.get(
			API_URL +
				"/api/users/get-pharmacists?pharmacyId=" +
				pharmacy.Id +
				"&startDateTime=" +
				new Date(
					this.state.selectedDate.getFullYear(),
					this.state.selectedDate.getMonth(),
					this.state.selectedDate.getDate(),
					this.state.hours,
					this.state.minutes,
					0,
					0
				).getTime(),
			{ validateStatus: () => true, headers: { Authorization: GetAuthorisation() } }
		)
			.then((res) => {
				if (res.status === 401) {
					this.setState({ unauthorizedRedirect: true });
				} else if (res.status === 200) {
					this.setState({ pharmacists: res.data, hiddenPharmacists: false, hiddenPharmacies: true });
					console.log(res.data);
				}
			})
			.catch((err) => {
				console.log(err);
			});
	};
    
    
    
    
    
    
    
    
    
    
    
    
    
    render() {
		return (
			<div hidden={this.props.hiddenPharmacies}>
				<div className="container">
                    
                    <table className="table table-hover" style={{ width: "90%", marginTop: "5em", marginLeft: "auto",marginRight: "auto" }}>
                                  <tbody>
                                      {this.props.pharmacies.map((pharmacy) => (
                                          <tr
                                              id={pharmacy.Id}
                                              key={pharmacy.Id}
                                              style={{ cursor: "pointer" }}
                                          >
          
                                            <td width="100px">  
                                            <img  src={PharmacyLogoPicture} style={{ width: "85px", marginTop: "15px" }}></img>                                 
                                                            
                                            </td>
                                              
                                              <td>
                                                            
                                                    <div>
                                                        <b>Name: </b> {pharmacy.EntityDTO.name}
                                                    </div>
                                                    <div>
                                                        <b>Address: </b> {pharmacy.EntityDTO.address.street}, {pharmacy.EntityDTO.address.city},{" "}
                                                        {pharmacy.EntityDTO.address.country}
                                                    </div>

                                                    <div>
                                                        <b>Consultation price:</b>{" "}
                                                        
                                                        {pharmacy.EntityDTO.price}                
                                                        <b> din</b>
                                                    </div>

                                                    <div>
                                                        <b>Grade: </b> {pharmacy.EntityDTO.grade}
                                                        <i className="icon-star" style={{ color: "yellow"}}></i>
                                                    </div>
                                            
                                                  
                                              </td>

                                            <td>
                                                <button
                                                        type="button"
                                                        className="btn btn-outline-primary"
                                                        onClick={() => this.showPharmacistForPharmacy(pharmacy)}
                                                >
                                                        Show pharmacists
                                                </button>
                                            </td>



                                          </tr>
                                      ))}
                                  </tbody>
                              </table>
                    </div>
			</div>
		);
	}
}

export default FoundPharmaciesForDateRange;
